import React from 'react';
import fixtures from '../apis/fixtures';

class App extends React.Component {
    constructor(props) {
        super(props);

        this.state = { fixtures: [] }

        fixtures.get().then(function(res) {
            console.log(res.data);
            //this.setState({ fixtures: res.data });
        }).catch(function (error) {
            console.log(error);
        });
    }

    render() { 

        return ( 
            <div>{this.state}</div>
         );
    }
}

export default App;
